import React from "react";
import Header from "./Header";
import Home from "./Home"
const Hero = ({ handleLogout }) => {
  return (
    <section className="hero">
      <nav>
      
        <button onClick={handleLogout}>Гарах</button>
      </nav>
      <Home/>
    </section>
  );
};
export default Hero;
